pragma solidity ^0.4.17;

import "../../base/owned.sol";
import "../../base/timestamped.sol";
import "../Timeline.sol";
import "./ITimelineDocumentLib.sol";

/**
 * Base Contract for TimeLineDocuments which contain specific information contributing
 * chronological data and events to building a comprehensive smart asset
 *
 * Copyright (c) 2017 Cognate, Inc.
 */
contract TimelineDocument is owned(msg.sender), timestamped {
    using ITimelineDocumentLib for ITimelineDocumentLib.TimelineDocumentStorage;

    ITimelineDocumentLib.TimelineDocumentStorage timelineDocument;

    constructor() public {
        timelineDocument._interfaceID = 0x79056e9bb24f897d7f885dacdb2d506599944c0cdfd6b7495eb7f3ea624ac5af;
    }


    // calls ITimelineDocumentLib.setNext()
    function setNext(TimelineDocument next) public {
        timelineDocument.setNext(next);
    }

    // calls ITimelineDocumentLib.setPrev()
    function setPrev(TimelineDocument prev) public {
        timelineDocument.setPrev(prev);
    }


    // Getters
    //--------

    function interfaceID() public view returns (bytes32) {
        return timelineDocument._interfaceID;
    }

    function next() public view returns (TimelineDocument) {
        return timelineDocument._next;
    }

    function prev() public view returns (TimelineDocument) {
        return timelineDocument._prev;
    }
}
